flag = ""

ROUNDS = 5
def encrypt(flag):
    enc = flag
    for _ in range(ROUNDS):
        enc = enc.hex()[::-1].encode()
    
    return enc.hex()

def decrypt(enc):
    dec = bytes.fromhex(enc)
    for _ in range(ROUNDS):
        dec = bytes.fromhex(dec.decode()[::-1])
    
    return dec

print(decrypt(flag))